Lemma ineq_f : 0 <= x1 <= 1 -> 0 <= x2 <= 1 ->  0 <= x3 <= 1 -> 0 <= x4 <= 1 -> 0 <= x5 <= 1 -> 0 <= x6 <= 1 -> IQR (fst_itv isos) <= fexpr <= IQR (snd_itv isos).
Proof.
  move => [C1le C1ge] [C2le C2ge] [C3le C3ge] [C4le C4ge] [C5le C5ge] [C6le C6ge]. 
  - apply fsa_in_itv_reif with (l:=envlift) (fe:=fe). by apply fexpr_reif.
  - apply correctf. 
    + split. by apply xge0_reif with (x:=x1). + split. by apply xle1_reif with (x:=x1).
    + split. by apply xge0_reif with (x:=x2). + split. by apply xle1_reif with (x:=x2).
    + split. by apply xge0_reif with (x:=x3). + split. by apply xle1_reif with (x:=x3).
    + split. by apply xge0_reif with (x:=x4). + split. by apply xle1_reif with (x:=x4).
    + split. by apply xge0_reif with (x:=x5). + split. by apply xle1_reif with (x:=x5).
    + split. by apply xge0_reif with (x:=x6). + split. by apply xle1_reif with (x:=x6).
    + by done.
Qed.
